import React from "react";
import './Nav.css'
import {Link,scrollSpy} from 'react-scroll'
import { useRef,useState,useEffect } from "react";
export default function Nav(){
    const ref=useRef()
    return(
        <div className="Nav" >
            <div className="Name">SaiBenne</div>
            <div className="Menu">
                <ul>
                    <li><Link to="Intro" smooth={true} duration={500} offset={-90} spy={true} activeClass="active">Intro</Link></li>
                    <li><Link to="Education" smooth={true} duration={500} offset={-91.1} spy={true} activeClass="active">Education</Link></li>
                    <li><Link to="Skills" smooth={true} duration={500} offset={-90} spy={true} activeClass="active">Skills</Link></li>
                    <li><Link to="Projects" smooth={true} duration={500} offset={-90} spy={true} activeClass="active">Projects</Link></li>
                    <li><Link to="Contact" smooth={true} duration={500} offset={-80} spy={true} activeClass="active">Contact</Link></li>
                </ul>
            </div>
        </div>
    )
}
